import React from 'react';

const Error = () => {
  return (
    <div className='error-container'>
      <div className='text-center'>
        <h1 className='main-title'>Oops, something is not right!</h1>
        <p className='text'>Try another page, or go back to the homepage</p>
      </div>
    </div>
  );
}

export default Error;
